import React from "react";

import '../Css/BotonColRND.css';

function BotonColRND({colorRND}, props) {
  return(
    <div>
      <label
        style={{color : `${colorRND}`}}>
          {props.texto}
      </label>
    </div>
  );
};

export default BotonColRND;
